import React, { Fragment, useEffect, useState } from "react"
import axios from 'axios';
import './welcome.css';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import CameraIcon from '@mui/icons-material/PhotoCamera';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import CircularProgress from '@mui/material/CircularProgress';
import { ToastContainer } from "react-toastify";
import { CartProvider, useCart } from "react-use-cart";
import { Rating } from "@mui/material";
import { CardImg } from "react-bootstrap";
import IconButton, { IconButtonProps } from '@mui/material/IconButton';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ProductDetail from "./ProductDetail";
import { Link } from "react-router-dom";




const Products = () => {



    const [showListProduct, setShowListProduct] = useState([])
    const [loader, setLoader] = useState(false)
    const [id, setId] = useState("")
  
    const {
      isEmpty,
      totalUniqueItems,
      items,
      updateItemQuantity,
      removeItem,
      addItem
    }  = useCart();
    console.log(showListProduct)

    

    
    

    const getAllProductFromApi = async() => {
        try {
            const res = await fetch 
                ('http://127.0.0.1:8000/api/product/')
                const repos = await res.json()
                setShowListProduct(repos)
             
              
               
            }  catch(error){
                    console.error(error)};
              
    }

    const changeState = (id) => { 
      console.log(id)
      setId(id)
    }
        
       
        
    const CircularIndeterminated = () => {
         console.log('aa')
        return (
           
            <Box sx={{ display: 'flex' }}>
                <CircularProgress />
            </Box> 
        )

    }

 
   

   /// useEffect(() =>{
     
        ///localStorage.setItem('cart', JSON.stringify(cart))
       


  

    useEffect(() => {
        
      getAllProductFromApi()
      
        // eslint-disable-next-line react-hooks/exhaustive-deps
        }, []);


        const theme = createTheme();

  
        return (
          
            <ThemeProvider theme={theme}>
              <ToastContainer />
              <CssBaseline />
              <AppBar position="relative">
              <Toolbar>
                </Toolbar>
               
              </AppBar>
              <main>
                {/* Hero unit */}
                <Box
                  sx={{
                    bgcolor: 'background.paper',
                    pt: 9,
                    pb: 6,
                  }}
                >
                  <Container maxWidth="md">
                  
                 
                    <Stack
                      sx={{ pt: 1}}
                      direction="row"
                      spacing={2}
                      alignItems="center"
                      justifyContent="space-between"
                    >
                     
                    </Stack>
                  </Container>
                </Box>
                <Container sx={{ py: 7 }} maxWidth="md">
                  {/* End hero unit */}
                  <Grid container paddingRight={2} xs={10} md={4} lg={11} paddingLeft={2} spacing={3}  rowSpacing={5} direction={'row'}>
                    {showListProduct ? showListProduct.map((items) => ( 
                     
                      <Grid item key={items.id}   xs={12} md={4} lg={4}

                      
                        
                      >
                        <Card className="my-3 p-9 rounded"
                           sx={{maxWidth:345}}>
                              <ProductDetail  elem={id}/> 
                        <Link  onClick={() => changeState(items.id)}
                       
                          to={`/product/${items.slug}`}>
                        
                        
                        
                          <CardImg
                            component="img"
                            sx={{
                              // 16:9
                              pt: '70%',
                            }}
                            src={items.image}
                            height='250'
                            
                            width='30'
                            
                      
                            alt="random"
                          />
                          </Link>
                          <CardContent sx={{ flexGrow: 1}}>
                            <Typography gutterBottom variant="h5" component="h1">
                              <h1>{items.titre}</h1>
                            </Typography>
                            <Typography>
                              <p>
                                {items.description}
                                
                              </p>
                            </Typography>
                            <Typography>
                              <p>
                                {items.price}$
                              </p>
                             
                            </Typography>

                          </CardContent>
                          <CardActions>
                            <Button size="small">View</Button>
                          
                            <Button onClick={() =>  addItem(items)} defaultValue={items.titre}  size="small">Add</Button>
                            <IconButton  aria-label="add to favorites">
                               <FavoriteIcon />
                            </IconButton>
                          </CardActions>
                        </Card>
                      </Grid>
                    )) : ( 
                        
                        <Box sx={{ display: 'flex' }}>
                            <CircularProgress />
                        </Box>   )
                        }
                        
                  </Grid>
                </Container>
              </main>
              {/* Footer */}
              
              {/* End footer */}
            </ThemeProvider>

       
    );
}
export default Products;
